"original": |2-
     The Unsupported response-header lists the features not supported by
     the responding RTSP agent.  In the case where the feature was
     specified via the Proxy-Require field (Section 18.37), if there is a
     proxy on the path between the client and the server, the proxy MUST
     send a response message with a status code of 551 (Option Not
     Supported).  The request MUST NOT be forwarded.
"fixed": |-
  The Unsupported response-header lists the features not supported by the responding RTSP agent.  In the case where the feature was specified via the Proxy-Require field (Section 18.37), if there is a proxy on the path between the client and the server, the proxy MUST send a response message with a status code of 551 (Option Not Supported).  The request MUST NOT be forwarded.
"ko": |-
  지원되지 않는 응답 헤더에는 응답하는 RTSP 에이전트가 지원하지 않는 기능이 나열되어 있습니다. Proxy-Require 필드(18.37절)를 통해 기능이 지정된 경우, 클라이언트와 서버 사이의 경로에 프록시가 있으면 프록시는 상태 코드 551(옵션이 아님)이 포함된 응답 메시지를 보내야 합니다. 지원됨). 요청은 전달되어서는 안 됩니다.
